var chart = new tauCharts.Chart({
    data: datasource,
    type: 'line',
    x: 'date',
    y: 'elo',
    color: 'wrestler',
    dimensions: {
      date: {
        type: 'measure',
        scale: 'time',
      },
      elo: {
        type: 'measure',
      },
      wrestler: {
        type: 'category',
      },
    },
    plugins: [
        tauCharts.api.plugins.get('tooltip')(),
        tauCharts.api.plugins.get('quick-filter')(['date']),
        tauCharts.api.plugins.get('legend')(),
    ]
});
chart.renderTo('#line');
